import React from 'react';
import './ImageLinkForm.css';

const initialState = {
  ip: '1.1.1',
  lastaccessed: ''
}

class ImageLinkForm extends React.Component {

  constructor(props) {
    super(props);
    this.state = initialState
  }

  onInputChange = (event) => {
    this.setState({input: event.target.value});
  }

  onButtonSubmit = () => {

    fetch('http://localhost:5000/api/login_attempt/4', {
      method: 'get',
      headers: {'Content-Type': 'application/json'}
    })
      .then(response => response.json())
      .then(login => {
        if (login.id) {
          this.state.ip = login.ip;
          this.state.lastaccessed = login.lastaccessed;
        }
      })

      this.setState({imageUrl: this.state.input});

  }

  render() {
    return (
    <div>
      <div>{this.state.ip}</div>
      <div className='center'>
        <div className='form center pa4 br3 shadow-5'>
          <input className='f4 pa2 w-70 center' type='text' onChange={this.onInputChange}/>
          <button
            className='w-30 grow f4 link ph3 pv2 dib white bg-light-purple'
            onClick={this.onButtonSubmit}
          >Upload</button>
        </div>
      </div>
    </div>
  );
 }
}

export default ImageLinkForm;
